script: |
  super -f text -I q3650.spq | sort > q3650.out

inputs:
  - name: q3650.spq
    data: |
      SELECT DISTINCT col1 FROM tab2 (FORMAT parquet) WHERE col1 * + CAST ( NULL AS REAL ) * + + 7 - col0 - - col0 * - + col0 NOT BETWEEN ( + col2 + col2 ) AND NULL;
  - name: tab2

outputs:
  - name: q3650.out
    data: |
